import { cn } from '@shared/lib/utils';
import Typography from '@shared/ui/Typography';
import { IconTrash2 } from '@shared/ui/icons';
import { getObjectUrlSelector, useAssetStore } from '@shared/preload-assets';

interface InventorySlotProps {
  className?: string;
  itemName?: string;
  itemImage?: string;
  state?: 'default' | 'selected' | 'delete';
  onClick?: () => void;
}

export default function InventorySlot({
  className,
  itemName = '아이템명',
  itemImage,
  state = 'default',
  onClick,
}: InventorySlotProps) {
  const isDelete = state === 'delete';
  const isSelected = state === 'selected';
  const getObjectUrl = useAssetStore(getObjectUrlSelector);
  return (
    <div
      className={cn(
        'relative aspect-square w-47.5 shrink-0',
        'cursor-pointer truncate',
        className
      )}
      onClick={onClick}
    >
      {/* 기본 슬롯 배경 */}
      <div
        className={cn(
          'absolute inset-0',
          'flex flex-col items-center gap-3',
          'rounded-[6px] px-8 py-3 lg:rounded-[12px]',
          {
            'border-[0.5px] border-[#939393] bg-[rgba(18,15,25,0.7)] lg:border-[1px]':
              !isSelected && !isDelete,
            'border-[0.75px] border-white bg-[linear-gradient(78deg,rgba(255,255,255,0.48)_-1.42%,rgba(255,255,255,0.20)_91.38%)] lg:border-[1.5px]':
              isSelected,
            'border-[0.5px] border-[#939393] lg:border-[1px]': isDelete,
          }
        )}
      >
        {/* 아이템 이미지 */}
        <div className='relative size-31.5 shrink-0'>
          {itemImage ? (
            <img
              alt={itemName}
              className='pointer-events-none absolute inset-0 size-full max-w-none object-cover'
              src={getObjectUrl(itemImage)}
            />
          ) : (
            <div className='absolute inset-0 bg-gray-600' />
          )}
        </div>

        {/* 아이템명 */}
        <Typography
          variant='caption'
          className='text-center whitespace-pre text-white'
        >
          {itemName}
        </Typography>
      </div>

      {/* Delete 상태 오버레이 */}
      {isDelete && (
        <>
          <DeleteOverlay />
          <IconTrash2 className='absolute inset-0 size-full px-12 pt-11 pb-16' />
        </>
      )}
    </div>
  );
}

